import React from 'react';
import Sidebar from '../components/Sidebar';
import '../styles/Horarios.css';

const Horarios = () => {
  return (
    <div className="horarios-page">
      <Sidebar />
      <div className="content">
        <h2>Horarios Importados</h2>
        <button>Importar Horario</button>
        <button>Sincronizar con Google Calendar</button>
        <table>
          <thead>
            <tr>
              <th>Clase</th>
              <th>Profesor</th>
              <th>Día</th>
              <th>Hora</th>
              <th>Aula</th>
            </tr>
          </thead>
          <tbody>
            {/* Aquí va el contenido de los horarios */}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Horarios;
